import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>PHOTO APP</h1>
        </header>
        <form>
          <fieldset>
            <input name="image" type="file" accept=".png"></input>
          </fieldset>
          <button>Upload</button>
        </form>
        </div>
  );

}

export default App;
